// GenderDropdown.js

import React from 'react';
import { GenderOption } from './menus/options'; // Importing Genders from options.js

const GenderDropdown = ({ onSelectGender }) => {
  return (
    <select onChange={(e) => onSelectGender(e.target.value)}>
      {Genders.map((GenderOption) => (
        <option key={GenderOption} value={GenderOption}>
          {gender}
        </option>
      ))}
    </select>
  );
};

export default GenderDropdown;
